import React, { Component } from 'react';

import location from '../images/loc.svg'

export default class IslandContainerGridItem extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return( <div class="island-container_grid_item">
                    <img src={this.props.img} alt="" />
                    <div class="island-container_grid_item_descripcion">
                    <b><spam>{this.props.name}</spam></b>
                    <div class="island-container_grid_item_descripcion_region">
                        <img
                        style="width: 10px; height: 10px"
                        src={location}
                        alt=""
                        />
                        <span>{this.props.location}</span>
                    </div>
                    </div>
                </div>)
    }
}
